import React from "react";
import {
  Route,
  Routes,
  NavLink,
  BrowserRouter
} from "react-router-dom";



export default function BasicExample() {
  return (
    <BrowserRouter>






      <Routes>
        <Route exact path="/" element={<Home />} />
      </Routes>

    </BrowserRouter>
  );
}



function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
